import React from 'react'
import logo from './logo.svg'
import './App.css'
import {GoogleMap, Marker} from 'google-map-react'
import getLatLng from './Geocoding.js'

const mapAPIKey = "AIzaSyBlE7GymtUyLM97k2QlT1lPUJCYU_1GHd4" // TODO MOVE THIS TO SECRETS FILE
const ithacaLatLng = [42.4534, -76.4735]
const mapZoom = 15

class App extends React.Component {
  render() {
    return (
      <div className="App" style={{width: 500}, {height: 500}}>
        <h1> Abode </h1>
        <GoogleMap
          bootstrapURLKeys={{key: mapAPIKey}}
          center={ithacaLatLng}
          zoom={mapZoom}>
            {/* <Marker position={getLatLng("414 Eddy St., Ithaca NY 14850")}/> */}
        </GoogleMap>
      </div>
    );
  }
}
